import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import cards from "./cards.json";
import Wrapper from "./components/Wrapper";
import Card from "./components/Card"

function App(){
  return(
    <Wrapper>
      <Card name = {cards[0].name} image={cards[0].image}/>
    </Wrapper>
  )
}

export default App;
